const getRandomNumber = (min, max) => {
  return parseInt(Math.random() * (Number(max) - Number(min) + 2));
};

export const dummyData = [
  {
    "2022-02-24": [
      {
        date_id: 1,
        picture: `https://picsum.photos/id/${getRandomNumber(1, 98)}/300/300`,
        text: "인상적",
      },
      {
        date_id: 2,
        picture: `https://picsum.photos/id/${getRandomNumber(1, 98)}/300/300`,
        text: `하하`,
      },
      {
        date_id: 3,
        picture: `https://picsum.photos/id/${getRandomNumber(1, 98)}/300/300`,
        text: `추억`,
      },
    ],
  },
  {
    "2022-04-12": [
      {
        date_id: 1,
        picture: `https://picsum.photos/id/${getRandomNumber(1, 98)}/300/300`,
        text: "상쾌함",
      },
    ],
  },
  {
    "2022-07-01": [
      {
        date_id: 1,
        picture: `https://picsum.photos/id/${getRandomNumber(1, 98)}/300/300`,
        text: "ㅎㅎㅎㅎ",
      },
      {
        date_id: 2,
        picture: `https://picsum.photos/id/${getRandomNumber(1, 98)}/300/300`,
        text: "운이 좋았다",
      },
    ],
  },
];
